window.bookSummaryJSON = "<p>It was supposed to be a fun night out with her friends. Instead, Callie finds herself ripped off the streets and thrust into a world filled with horrors she never imagined. Then she meets him, and the monster bites her. However, she quickly realizes the blood-sucking freak is her only hope of escaping the murderous creatures who abducted her.</p> <p>Out of his mind with hunger, Lucien can only think about one thingâ€¦feeding. Until he gets his hands on her. Torn between madness and his desperate need to protect Callie, Lucien struggles to suppress the savage urges threatening to consume him while he battles to keep her alive. But when someone from his past returns, can he push aside his growing insanity to save her, or will his bloodlust and hatred consume him?</p> <p>The Alliance series is a spin-off of the Vampire Awakenings series. You do not have to listen to the Vampire Awakenings series to follow the Alliance series. Due to violence, language, and sexual content, this book is recommended for listeners 18 years of age and older.</p>"; 
